import React from "react";

const card = () => {
    return(
        <div>
            <h1>Robofriends</h1>
            <img alt="robot" src="https://robohash.org/Leanne Graham" />
            <div>
                <h2>Leanne Graham</h2>
                <p>Sincere@april.biz</p>
            </div>
        </div>
    );
}

export default card
